    "Cooperative Recovery Initiative Annual Report: Enhancement of Razorback Sucker
    Recruitment through Restoration of Sheppard Bottom, Ouray National Wildlife Refuge",nt"tracking_summary":
    {ntt"total": 2,ntt"recent": 0nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-08-30T12:25:13.264045",nt"name": "cooperative-recovery-initiative-annual-report-enhancement-of-razorback-sucker-recruitment-",nt"isopen":
    false,nt"url": null,nt"notes": "Recovery of endangered razorback sucker
    (Xyrauchen texanus) requires consistent recruitment of wild fish into adulthood.
    To successfully recruit, the species requires functional connections to off-channel
    wetlands after spawning. Off-channel wetlands in the middle Green River, including
    those at Ouray NWR, have demonstrated the ability to provide this crucial life history
    component. Unfortunately, recent habitat changes on Ouray NWR severed the connection
    between the Sheppard Bottom wetland and the Green River. This CRI project will restore
    this connection by breaching a levee and facilitating water movement within wetland
    areas, thus providing essential nursery habitat for juvenile razorback suckers.",nt"license_title":
